import React from "react";

function Service_intro(){
    const Service_introList = [
        { title: '질문 일기장', description: '오늘 하루를 질문과 감정으로 정리해요.' },
        { title: '다양한 감정 템플릿', description: '감정별 템플릿으로 감정을 표현해보세요.' },
        { title: '타임캡슐 메이커', description: '일기를 통해 과거의 나와 만나는 경험을 제공해요.' },
        { title: '나의 감정을 돌보는', description: '나만의 기록을 만들어요.' },
    ];

    return (
        <section className="services">
            <h2>FeelsLike's Service</h2>
            {Service_introList.map((service, index) => (
                <div key={index} className="service-box">
                    <h3>{service.title}</h3>
                    <p>{service.description}</p>
                <div className="placeholder-image"/>
                </div>
            ))}
        </section>
    );
}

export default Service_intro;
